import React, { Component } from 'react';
import axios from 'axios';
import NavbarHeader from './navbarhead';
import Timeslots from './Timeslots';
import './App.css';
class App extends Component {

  constructor(props) {
    super(props);

    this.state = {
      data: [],
    };
  }

  componentDidMount() {
    fetch('http://localhost:4000/purchase')   
    .then( (response) => { 
      console.log("response");        
      console.log(response);
      let cmpt = this;        
      response.json().then((result) => cmpt.setState({ results: result }));
    }) // if the response is a JSON object  
  }

  render() {
    return (
        <div className="App">
          <NavbarHeader />
          <Timeslots />
          <div>
            {this.state.data}
          </div>

        </div>
    )
  }
}

export default App;
